import React from 'react';
import Layout from './Layout';

const App = () => {
  return (
    <Layout>
      {/* Content goes here */}
      <h1 className="text-2xl font-bold">Hello World</h1>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit...</p>
    </Layout>
  );
};

export default App;
